import React from 'react';
import '../styles/eva.css'
import logo_white from './icons/logo_white.png';
import Typical from 'react-typical'
import 'bootstrap/dist/css/bootstrap.min.css';
import EVA_cover from './EVA_cover';


class EVA extends React.Component {
  render() {

    return (
        <div className="EVAcover">
        <EVA_cover/>
          <img src={logo_white} className="EVAcover_logo"></img>

          <p className="EVAhead">Euclid Vision Analytic</p>
           <Typical className="EVAhead"
            steps={['Designing Products that matter.',1]}
            loop={2}
            wrapper="p"
          />
        </div>
    );
  }
}
export default EVA;
